import React from "react";
import Todo from "../components/Todo";

const Todos = (props) => {
  const clickRemoveTodo = (id) => {
    props.clickRemoveTodo(id);
  };

  const clickChangeComplited = (id) => {
    props.clickChangeComplited(id);
  };

  return (
    <div className="todos_wrapper">
      <ul className="todos">
        {props.todos.map((todo, index) => (
          <Todo
            todo={todo}
            key={todo.id}
            clickRemoveTodo={clickRemoveTodo}
            clickChangeComplited={clickChangeComplited}
            index={index}
          />
        ))}
      </ul>
    </div>
  );
};

export default Todos;
